const cars = [
  {
    name: "Model 3",
    image:
      "data:image/jpeg;base64,"
  },
  {
    name: "Model X",
    image:
      "data:image/jpeg;base64,"
  },
  {
    name: "Model S",
    image:
      "data:image/jpeg;base64,"
  }
];

module.exports = {
  getCars: (req, res) => {
    res.status(200).send(cars);
  },

  addCar: (req, res) => {
    // cars.push({ name, image });
    let { name, image } = req.body;
    cars.unshift({ name, image });
    res.status(200).send(cars);
  }
};
